import React from 'react'
import { View, Text ,Button} from 'react-native'
import {useDispatch, useSelector} from 'react-redux'
import { setIncrement,setDecrement } from './redux/counterAction'

const Counter = () => {
    const dispatch = useDispatch;
    const count = useSelector(data => data.count )
    return (
        <View>
            <Text>
                {count}
            </Text>
            <Button title='increment' onPress={()=>dispatch(setIncrement(counter))} >tambah</Button>
            <Button title='decrement' onPress={() =>dispatch(setDecrement(counter))} >kurang</Button>
        </View>
    )
}

export default Counter
